import React from 'react';
import './PumpkinPlot.css';

const PumpkinPlot = ({pumpkin}) => {
  const pumpkinImage = require.context(pumpkin.src, true);
  let pumpkinImg = images('./' + props.imageName);

  return (
    <div className="pumpkin-plot">
      {pumpkin && <img src={pumpkin.src} alt={pumpkin.title}/>}
    </div>
  );
};

export default PumpkinPlot;
